import{_ as o,c,a as d,o as a}from"./app-CTIoDS1N.js";const i={};function t(l,e){return a(),c("div",null,e[0]||(e[0]=[d('<h1 id="介绍" tabindex="-1"><a class="header-anchor" href="#介绍"><span>介绍</span></a></h1><p>来自灵魂的考验：今天你 emo 了吗？</p><p><code>emo</code> 是一个基于 <code>Jetpack Compose</code>、协程、<code>Flow</code>、<code>ksp</code> 等开发的现代化 <code>Android</code> 组件库集合。</p><p>每一个 <code>app</code> 发展到一定程度都会开始去沉淀一份基础组件库，功能都大同小异，所以 <code>emo</code> 的一个发展方向就是成为一个通用基础组件库，帮助开发者写出更高效、更简洁、更强壮的业务代码。</p><ul><li>如果你是启动一个新的项目，那么引入 <code>emo</code> 将是不二之选。</li><li>如果你想抽取并提炼基础组件库，那不妨看看 <code>emo</code> 已经帮你做了哪些？</li><li>如果你追求跨平台，那你可以离开了。</li><li>如果你沉迷写 <code>xml</code> 不能自拔，那你也可以离开了。</li></ul><p>那么，就查看左边目录，看看是否有你感兴趣的组件吧~</p>',6)]))}const p=o(i,[["render",t],["__file","index.html.vue"]]),m=JSON.parse('{"path":"/guide/","title":"介绍","lang":"zh-CN","frontmatter":{},"headers":[],"git":{"updatedTime":1672995528000,"contributors":[{"name":"cgspine","email":"cgspine@gmail.com","commits":2}]},"filePathRelative":"guide/README.md"}');export{p as comp,m as data};
